import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Header from './Header';
import { Link } from 'react-router-dom';
import '../styles/Live.css';

const Live = () => {
    const [liveStreams, setLiveStreams] = useState([]);
    const [filterCategory, setFilterCategory] = useState('');
    const categories = [
        'All',
        'Fortnite',
        'Minecraft',
        'League of Legends',
        'Chatting',
        'In Real Life',
        'Grand Theft Auto V',
        'EA Sports FC 24',
        'Among Us',
        "Tom Clancys Rainbow Six Siege",
        'Call Of Duty: Modern Warfare III',
        'Apex Legends',
        'Valorant',
        'Dota 2',
        'Counter-Strike',
        'Art',
        'Education'
    ];
    const sortOptions = [
        { value: 'viewCount', label: 'View Count' },
        { value: 'duration', label: 'Duration' },
    ];


    const categoryThumbnails = {
        "Fortnite": "https://www.gamespot.com/a/uploads/screen_kubrick/1352/13527689/3928496-fortnite2022-01-1808-32-56.00_01_08_23.still001.jpg",
        "Minecraft": "https://static.wikia.nocookie.net/minecraft_gamepedia/images/6/60/Survival.png/revision/latest/scale-to-width-down/427?cb=20220702034959",
        "League Of Legends": "data:image/jpeg;base64,",
        "Chatting": "data:image/jpeg;base64,",
        "In Real Life": "data:image/jpeg;base64,",
        "Grand Theft Auto V": "data:image/jpeg;base64,",
        "EA Sports FC 24": "data:image/jpeg;base64,",
        "Among Us": "data:image/jpeg;base64,",
        "Tom Clancys Rainbow Six Siege": "data:image/jpeg;base64,",
        "Call Of Duty: Modern Warfare III": "data:image/jpeg;base64,",
        "Apex Legends": "data:image/jpeg;base64,",
        "Valorant": "data:image/jpeg;base64,",
        "Dota 2": "data:image/jpeg;base64,",
        "Counter-Strike": "data:image/jpeg;base64,",
        "Art": "data:image/jpeg;base64,",
        "Education": "data:image/jpeg;base64,",
    };

    useEffect(() => {
        axios.get('https://streamflow-backend.onrender.com/streams')
            .then(response => {
                setLiveStreams(response.data.streams.sort((a, b) => b.currentViewers - a.currentViewers));
            })
            .catch(error => console.error("Error fetching live streams:", error));
    }, []);

    const handleCategoryChange = e => {
        const selectedCategory = e.target.value;
        setFilterCategory(selectedCategory === "All" ? "" : selectedCategory);
    };

    const handleSortChange = (event) => {
        const sortValue = event.target.value;
        const sortedStreams = [...liveStreams].sort((a, b) => {
            if (sortValue === 'viewCount') {
                return b.currentViewers - a.currentViewers;
            } else if (sortValue === 'duration') {
                return b.streamDuration - a.streamDuration;
            }
        });
        setLiveStreams(sortedStreams);
    };
    

    const filteredStreams = liveStreams.filter(stream => filterCategory === "" || stream.category === filterCategory);


    return (
        <div>
            <Header />
            <div className="live-streams-container">
                <h1 className="live-streams-title">Live Streams</h1>
                <div className="filter-container">
                    <select onChange={handleCategoryChange} value={filterCategory} className="stream-filter-dropdown">
                        {categories.map(category => (
                            <option key={category} value={category}>{category}</option>
                        ))}
                    </select>
                    <select onChange={handleSortChange} className="stream-sort-dropdown">
                        {sortOptions.map((option, index) => (
                            <option key={index} value={option.value}>
                                {option.label}
                            </option>
                        ))}
                    </select>

                </div>
                <div className="stream-grid">
                    {filteredStreams.map((stream, index) => (
                        <div key={stream._id || index} className="stream-card">
                            <div className="streamer-info-container">
                                <img src={stream.streamerAvatar} alt="Streamer Avatar" className="streamer-avatar" />
                                <p className="streamer-username">{stream.streamerUsername}</p>
                            </div>
                            <img src={categoryThumbnails[stream.category] || 'default_thumbnail.jpg'} alt={`${stream.title} thumbnail`} className="stream-thumbnail" />
                            <div className="stream-info">
                                <h2 className="stream-title">{stream.streamTitle}</h2>
                                <div className="category-name">{stream.category}</div>
                                <div className="watch-viewers-count">
                                    <Link to={`/stream/${stream._id}`} className="watch-stream-link">Watch Stream</Link>
                                    <p className="stream-viewer-count">{stream.currentViewers} viewers</p>
                                </div>
                            </div>
                        </div>
                    ))}
                </div>
            </div>
        </div>
    );

};

export default Live;



